INSERT INTO `noticias` (`idnoticia`, `fecha`, `titulo`, `volanta`, `contenido`, `bajada`, `fuente`) VALUES
(1, '2008-06-02 18:05:49', 'Perú se blindará antes del choque que sostendrá co', 'Aún hay esperanzas', 'La selección peruana llegará a Montevideo y de inmediato será custodiada por doce efectivos de la Policía Nacional de Uruguay, tal como fue solicitado por la dirigencia del combinado blanquirrojo, que teme que el empate que obtuvieron los celestes con Venezuela motive a sus hinchas a tomar algún tipo de medida amedrentadora.', 'La selección rojiblanca será custodiada por un fuerte contingente policial durante su estadía en Montevideo', 'El Comercio'),
(2, '2008-06-05 18:07:43', '\'Ojalá le podamos dar a los padres la alegría que ', 'Por el dia del Padre', 'El mensaje de Nolberto Solano da esperanzas. En pleno día del padre, cuando todos esperaban un tibio saludo del capitán de la selección, Ñol lanzó algoq ue suena a promesa: \"A todos los padres, que pasen un buen día y ojalá les podamos dar una alegría el día martes, ya que no se la pudimos dar ayer\".', 'Solano espera que contra Uruguay, Perú levante cabeza siguiendo la receta de Venezuela', 'Agencia EFE');
