INSERT INTO `visitas` (`idvisita`, `nombres`, `correoelectronico`, `comentario`, `edad`) VALUES
(1, 'Pedro Picapiedras', 'pedro@gmail.com', 'Han pasado dos años desde que el tranquilo Peter Parker (Tobey Maguire) dejó a su amor de toda la vida, Mary Jane Watson (Kirsten Dunst) y decidió seguir el camino de la res-ponsabilidad como Spider-Man. Peter debe afrontar nuevos desafíos mientras lucha contra “el don y la maldi-ción” de sus poderes equilibrando sus identidades duales como el ', 34),
(2, 'Pablo Marmol', 'pablo@hotmail.com', 'escurridizo superhéroe Spider-Man y la vida como estudiante uni-versitario. Las relaciones con las personas que más aprecia están ahora en peligro de ser descubiertas con la aparición del poderoso villano de múltiples tentáculos Doctor Octopus, “Doc Ock” (Alfred Molina). Su atracción de siempre por Mary Jane se hace incluso más fuerte mientras lucha contra el impulso de abandonar su vida secreta y declarar su amor. ', 29),
(3, 'Popeye El Marino', 'poeye@yahoo.es', 'Mientras tanto, Mary ha seguido con su vida. Se ha embarcado en su carrera de actriz y tiene un nuevo hombre en su vida. La relación de Peter con su mejor amigo Harry Osborn (James Franco) se ha ensombrecido por la creciente ven-ganza de Harry contra Spider-Man, al que considera responsable de la muerte de su padre. La vida de Peter se convierte en aún más complicada cuando ha de enfrentarse con su poderoso nuevo ene-migo, el', 26),
(4, 'Marge Simpson', 'marge@gmail.com', 'La vida de Peter se convierte en aún más complicada cuando ha de enfrentarse con su poderoso nuevo ene-migo, el Dr. Otto Octavius (Molina). Peter debe aprender ahora a aceptar su destino y a utilizar todos sus talentos como superhéroe para detener a este loco diabólico de ocho brazos.', 31),
(5, 'Cocolizo El Marino', 'cocolizo@yahoo.es', 'A Franco se le podrá ver próximamente en la película de Robert Altman The Company, al lado de Neve Campbell y en The Great Raid, de John Dahl junto a Benjamin Bratt. Su papel protagónico mas reciente fue en Sonny debut como director de Nicolas Cage, así como en City by the Sea al lado de Robert DeNiro dirigida por Michael Caton-Jones. Entre otros logros podemos incluir la producción de Martin Scorsese Deuces Wild, Whatever It Takes and Never Been Kissed. En cuanto a trabajo en televisión se refiere, Franco protagonizo la serie de NBC Freaks and Geeks.', 18),
(6, 'Juan Valdivia', 'juan@gmail.com', 'interesante la informacion', 23),
